import React from "react";
import ReactDom from "react-dom";
import "./header.css";

const Header = () => {
	return (
		<header-container>
			<div class="header-content">
				<header-title>Insert Inspirational Quote</header-title>
			</div>
		</header-container>
	);
};

export default Header;
